import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes.js";

function renderNotes(note) {
  return (
    <Note
    key = {note.key}
    title = {note.title}
    content = {note.content}
    />
  );
}

function App() {
  return (
    <div>
    <h1> Hi </h1>
      <Header />
      {notes.map(renderNotes)}
      <Footer />
    </div>
  );
}

export default App;
